import React from "react";
import { Link } from "react-router-dom";
import { Nav } from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Nav>
        <Link to="rosary">Test link</Link>
      </Nav>
    </div>
  );
};

export default NavBar;
